def interpolationSearch(lst, y):
    lst.sort()
    low = 1
    high = len(lst) - 1
    while low <= high and y >= lst[low] and (y <= lst[high]):
        if low == high:
            if lst[low] == y:
                return low
            return -1
        pos = low + (high - low) // (lst[high] - lst[low]) * (y - lst[low])
        if lst[pos] == y:
            return pos
        if lst[pos] < y:
            low = pos + 1
        else:
            high = pos - 1
    return -1

